selector_to_html = {"a[href=\"#id1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Disabilita<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/02771.png\"><img alt=\"../../media/02771.png\" src=\"../../media/02771.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Abilita</span><a class=\"headerlink\" href=\"#id8\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../media/013300.png\"><img alt=\"../../media/013300.png\" src=\"../../media/013300.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Modalit\u00e0 Trigger Chiave</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#scan-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Scansione<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Modalit\u00e0 Tasto Innesco<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Premere il pulsante per attivare la scansione e rilasciare il pulsante per terminare la scansione. La scansione termina quando la scansione ha successo o il tempo di lettura supera il tempo di lettura singolo.</p>", "a[href=\"#disable\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Disabilita<a class=\"headerlink\" href=\"#disable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#enable\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Abilita<a class=\"headerlink\" href=\"#enable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/02310.png\"><img alt=\"../../media/02310.png\" src=\"../../media/02310.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Disabilita</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/02770.png\"><img alt=\"../../media/02770.png\" src=\"../../media/02770.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Disabilita</span><a class=\"headerlink\" href=\"#id7\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/02311.png\"><img alt=\"../../media/02311.png\" src=\"../../media/02311.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Abilita</span><a class=\"headerlink\" href=\"#id6\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id12\"]": "<figure class=\"align-center\" id=\"id12\">\n<a class=\"reference internal image-reference\" href=\"../../media/026332.png\"><img alt=\"../../media/026332.png\" src=\"../../media/026332.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">5s</span><a class=\"headerlink\" href=\"#id12\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Di Sensibilit\u00e0 Automatica<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>Nella modalit\u00e0 di rilevamento automatico, lo scanner rileva la luminosit\u00e0 dell\u2019ambiente circostante. Quando la luminosit\u00e0 cambia, la scansione viene attivata. La scansione termina quando la scansione ha successo o il tempo di scansione supera il tempo di lavoro singolo. Indipendentemente dal fatto che l\u2019ultima scansione abbia avuto successo o fallito, la luminosit\u00e0 dell\u2019ambiente circostante verr\u00e0 nuovamente rilevata.</p>", "a[href=\"#id10\"]": "<figure class=\"align-center\" id=\"id10\">\n<a class=\"reference internal image-reference\" href=\"../../media/026314.png\"><img alt=\"../../media/026314.png\" src=\"../../media/026314.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">2s</span><a class=\"headerlink\" href=\"#id10\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#repeat-barcode-interval\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Ripeti Intervallo Codici A Barre<a class=\"headerlink\" href=\"#repeat-barcode-interval\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Tasto Innesco<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Premere il pulsante per attivare la scansione e rilasciare il pulsante per terminare la scansione. La scansione termina quando la scansione ha successo o il tempo di lettura supera il tempo di lettura singolo.</p>", "a[href=\"#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Continua<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>Lo scanner funziona in modo continuo. Se la scansione \u00e8 riuscita o il tempo di scansione supera il tempo di lavoro singolo, la scansione corrente termina. Se il tempo supera il tempo specificato, la scansione successiva viene attivata automaticamente.</p>", "a[href=\"#duplicate-barcode-detection-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Di Rilevamento Codici A Barre Duplicate<a class=\"headerlink\" href=\"#duplicate-barcode-detection-settings\" title=\"Link to this heading\">#</a></h2><h3>Disabilita<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Abilita<a class=\"headerlink\" href=\"#id2\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id13\"]": "<figure class=\"align-center\" id=\"id13\">\n<a class=\"reference internal image-reference\" href=\"../../media/026364.png\"><img alt=\"../../media/026364.png\" src=\"../../media/026364.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">10s</span><a class=\"headerlink\" href=\"#id13\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/02630A.png\"><img alt=\"../../media/02630A.png\" src=\"../../media/02630A.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">1s</span><a class=\"headerlink\" href=\"#id9\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id11\"]": "<figure class=\"align-center\" id=\"id11\">\n<a class=\"reference internal image-reference\" href=\"../../media/02631E.png\"><img alt=\"../../media/02631E.png\" src=\"../../media/02631E.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">3s</span><a class=\"headerlink\" href=\"#id11\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id4\"]": "<figure class=\"align-center\" id=\"id4\">\n<a class=\"reference internal image-reference\" href=\"../../media/013304.png\"><img alt=\"../../media/013304.png\" src=\"../../media/013304.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Modalit\u00e0 Continua</span><a class=\"headerlink\" href=\"#id4\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
